    </Col>
    <Col>
    <Image src={Img01} fluid/>
    </Col>
    <Col>
    <Image src={Img02} fluid/>
    </Col>
  </Row>
  <Row>
    <Col>
    <Image src={Img03} fluid/>
    </Col>
    <Col>2 of 3</Col>
    <Col>3 of 3</Col>
  </Row>
</Container>

</>
      /* End of JSX Fragment*/
)
